function I = fcnK7M(S, T, u, alpha, F, tol)
t1 = F .^ 2;t3 = sqrt(t1 + u);t4 = 0.1e1 ./ t3;t10 = alpha .^ 2;t11 = -alpha + u;t12 = 0.1e1 ./ t11;t13 = t12 .* t10;t14 = sqrt(-alpha);t15 = F - t14;t16 = t15 .^ 2;t17 = t15 .* t14;t20 = sqrt(t16 + 0.2e1 .* t17 - alpha + u);t21 = 0.1e1 ./ t20;t24 = t14 .* t10;t25 = t12 .* t24;t27 = 0.1e1 ./ u .* F;t28 = t21 .* t27;t31 = sqrt(t11);t34 = 0.1e1 ./ t31 ./ t11 .* t10;t37 = 0.1e1 ./ t15;t39 = log(0.2e1 .* t37 .* (t20 .* t31 - alpha + t17 + u));t42 = F + t14;t43 = t42 .^ 2;t44 = t42 .* t14;t47 = sqrt(t43 - 0.2e1 .* t44 - alpha + u);t48 = 0.1e1 ./ t47;t51 = t48 .* t27;t56 = 0.1e1 ./ t42;t58 = log(0.2e1 .* t56 .* (t47 .* t31 - alpha - t44 + u));t65 = t10 .* alpha;t66 = t11 .^ 2;t67 = 0.1e1 ./ t66;t68 = t67 .* t65;t72 = t67 .* t14 .* t65;t77 = 0.1e1 ./ t31 ./ t66 .* t65;t90 = t4 .* t1 + 0.2e1 .* t4 .* u + 0.2e1 .* t4 .* alpha + 0.3e1 ./ 0.2e1 .* t21 .* t13 - 0.2e1 .* t28 .* t25 - 0.3e1 ./ 0.2e1 .* t39 .* t34 + 0.3e1 ./ 0.2e1 .* t48 .* t13 + 0.2e1 .* t51 .* t25 - 0.3e1 ./ 0.2e1 .* t58 .* t34 - t21 .* t37 .* t12 .* t24 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t21 .* t68 - 0.3e1 ./ 0.4e1 .* t28 .* t72 - 0.3e1 ./ 0.4e1 .* t39 .* t77 + t48 .* t56 .* t12 .* t24 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t48 .* t68 + 0.3e1 ./ 0.4e1 .* t51 .* t72 - 0.3e1 ./ 0.4e1 .* t58 .* t77;
I = t90(:,:,2) - t90(:,:,1);

end
